---
openfoam: [9]
version: 0.11.0
order:
    - meta
    - foam
    - static
    - other
---
"0":
    p:
        FoamFile: &FoamFile
            version: 2.0
            format: ascii
            class: volScalarField
            object: p
        dimensions: "[0 2 -2 0 0 0 0]"
        internalField: uniform 0
        boundaryField:
            inlet:
                type: zeroGradient
            outlet:
                type: fixedValue
                value: uniform 0
            upperWall:
                type: zeroGradient
            lowerWall:
                type: zeroGradient
            frontAndBack:
                type: empty
    U:
        FoamFile:
            class: volVectorField
            object: U
            <<: *FoamFile
        dimensions: "[0 1 -1 0 0 0 0]"
        internalField: uniform (0 0 0)
        boundaryField:
            inlet:
                type: fixedValue
                value: uniform (1 0 0)
            outlet:
                type: zeroGradient
            upperWall:
                type: noSlip
            lowerWall:
                type: noSlip
            frontAndBack:
                type: empty
constant:
    transportProperties:
        FoamFile:
            class: dictionary
            object: transportProperties
            <<: *FoamFile
        transportModel: Newtonian
        nu: 1e-05
    turbulenceProperties:
        FoamFile:
            class: dictionary
            object: turbulenceProperties
            <<: *FoamFile
        simulationType: laminar
system:
    blockMeshDict:
        FoamFile:
            class: dictionary
            object: blockMeshDict
            <<: *FoamFile
        scale: 1
        vertices:
            - name v1 (0 0 -0.05)
            - name v2 (1 0 -0.05)
            - name v3 (1.5 0.5 -0.05)
            - name v4 (1 1 -0.05)
            - name v5 (0 1 -0.05)
            - name v6 (0 0.75 -0.05)
            - name v7 (1 0.75 -0.05)
            - name v8 (1.25 0.5 -0.05)
            - name v9 (1 0.25 -0.05)
            - name v10 (0 0.25 -0.05)
            #
            - name v11 (0 0 0.05)
            - name v12 (1 0 0.05)
            - name v13 (1.5 0.5 0.05)
            - name v14 (1 1 0.05)
            - name v15 (0 1 0.05)
            - name v16 (0 0.75 0.05)
            - name v17 (1 0.75 0.05)
            - name v18 (1.25 0.5 0.05)
            - name v19 (1 0.25 0.05)
            - name v20 (0 0.25 0.05)
        blocks:
            - hex (v1 v2 v9 v10 v11 v12 v19 v20) (20 20 1) simpleGrading (1 1 1)
            - hex (v2 v3 v8 v9 v12 v13 v18 v19) (20 20 1) simpleGrading (1 1 1)
            - hex (v3 v4 v7 v8 v13 v14 v17 v18) (20 20 1) simpleGrading (1 1 1)
            - hex (v4 v5 v6 v7 v14 v15 v16 v17) (20 20 1) simpleGrading (1 1 1)
        edges:
            - |
                arc v2 v3 (#calc "0.5*cos(3.14159265359/-4)+1.0" #calc "0.5*sin(3.14159265359/-4)+0.5" -0.05)
            - |
                arc v12 v13 (#calc "0.5*cos(3.14159265359/-4)+1.0" #calc "0.5*sin(3.14159265359/-4)+0.5" 0.05)
            - |
                arc v9 v8 (#calc "0.25*cos(3.14159265359/-4)+1.0" #calc "0.25*sin(3.14159265359/-4)+0.5" -0.05)
            - |
                arc v19 v18 (#calc "0.25*cos(3.14159265359/-4)+1.0" #calc "0.25*sin(3.14159265359/-4)+0.5" 0.05)
            - |
                arc v3 v4 (#calc "0.5*cos(3.14159265359/4)+1.0" #calc "0.5*sin(3.14159265359/4)+0.5" -0.05)
            - |
                arc v13 v14 (#calc "0.5*cos(3.14159265359/4)+1.0" #calc "0.5*sin(3.14159265359/4)+0.5" 0.05)
            - |
                arc v8 v7 (#calc "0.25*cos(3.14159265359/4)+1.0" #calc "0.25*sin(3.14159265359/4)+0.5" -0.05)
            - |
                arc v18 v17 (#calc "0.25*cos(3.14159265359/4)+1.0" #calc "0.25*sin(3.14159265359/4)+0.5" 0.05)
        defaultPatch:
            type: empty
            name: frontAndBack
        boundary:
            - inlet:
              type: patch
              faces:
                - (v1 v10 v20 v11)
            - outlet:
              type: patch
              faces:
                - (v5 v6 v16 v15)
            - upperWall:
              type: wall
              faces:
                - (v10 v9 v19 v20)
                - (v9 v8 v18 v19)
                - (v8 v7 v17 v18)
                - (v7 v6 v16 v17)
            - lowerWall:
              type: wall
              faces:
                - (v1 v2 v12 v11)
                - (v2 v3 v13 v12)
                - (v3 v4 v14 v13)
                - (v4 v5 v15 v14)
    controlDict:
        FoamFile:
            class: dictionary
            object: controlDict
            <<: *FoamFile
        application: simpleFoam
        startFrom: startTime
        startTime: 0
        stopAt: endTime
        endTime: 1000
        deltaT: 1
        writeControl: timeStep
        writeInterval: 100
        purgeWrite: 0
        writeFormat: ascii
        writePrecision: 6
        writeCompression: off
        timeFormat: general
        timePrecision: 6
        runTimeModifiable: true
        functions: {}
    decomposeParDict:
        FoamFile:
            class: dictionary
            object: decomposeParDict
            <<: *FoamFile
        numberOfSubdomains: 4
        method: hierarchical
        coeffs:
            n: (2 2 1)
            distributed: no
            roots: ( )
    fvSchemes:
        FoamFile:
            class: dictionary
            object: fvSchemes
            <<: *FoamFile
        ddtSchemes:
            default: steadyState
        gradSchemes:
            default: Gauss linear
        divSchemes:
            default: none
            div(phi, U): bounded Gauss upwind
            div(phi, k): bounded Gauss upwind
            div(phi, epsilon): bounded Gauss upwind
            div(phi, R): bounded Gauss upwind
            div(R): Gauss linear
            div(phi, nuTilda): bounded Gauss upwind
            div((nuEff*dev2(T(grad(U))))): Gauss linear
        laplacianSchemes:
            default: Gauss linear corrected
        interpolationSchemes:
            default: linear
        snGradSchemes:
            default: corrected
    fvSolution:
        FoamFile:
            class: dictionary
            object: fvSolution
            <<: *FoamFile
        solvers:
            p:
                solver: GAMG
                tolerance: 1e-06
                relTol: 0.1
                smoother: GaussSeidel
            (U|k|epsilon|R|nuTilda):
                solver: smoothSolver
                smoother: symGaussSeidel
                tolerance: 1e-05
                relTol: 0.1
        SIMPLE:
            nNonOrthogonalCorrectors: 0
            residualControl:
                p: 1e-2
                U: 1e-3
                (k|epsilon|omega): 1e-3
        relaxationFactors:
            fields:
                p: 0.3
            equations:
                U: 0.7
                k: 0.7
                epsilon: 0.7
                R: 0.7
                nuTilda: 0.7
---
-
    name: Allrun
    type: [embed, text]
    permission: 777
    data: |
        #!/bin/bash

        blockMesh > log.blockMesh 2>&1
        simpleFoam > log.simpleFoam 2>&1

        ofTutorial16 2>&1 | tee log.particleTracking

        echo "Now run paraview --state=viewData.pvsm"
-
    name: Allclean
    type: [embed, text]
    permission: 777
    data: |
        #!/bin/bash

        # starting simulation
        rm -f log.*
        rm -rf VTK
        foamListTimes -rm
        rm -rf constant/polyMesh/* dynamicCode
